package model.repository;import model.entity.RegistruOGBEntity;import org.springframework.data.jpa.repository.Query;import org.springframework.data.repository.CrudRepository;import java.sql.Date;import java.util.List;public interface RegistruOGBRepository extends CrudRepository<RegistruOGBEntity, Long> {    RegistruOGBEntity findFirstByOrderByIdRegistruOgbDesc();    RegistruOGBEntity findOneByNrInregistrareEquals(String nrInregistrare);    @Query(value = "SELECT * FROM registru_ogb i WHERE i.rezervat = 1 AND i.data_inregistrare <= ?", nativeQuery = true)    List<RegistruOGBEntity> findAllRezervateDeAnulat(Date dataTinta);}